import React from 'react';
import styled from 'styled-components';

import Arrow from '../../images/arrow.svg';

const BtnContainer = styled.div`
  width: 85px;
  height: 85px;
  background: black;
  border-radius: 50%;
`;

const ArrowIcon = styled.img`
  width: 80%;
  height: 80%;
`;

function Button() {
  return (
    <BtnContainer>
      <ArrowIcon src={Arrow} alt="button" />
    </BtnContainer>
  );
}

export default Button;
